import React from 'react';

const num =  Math.round(Math.random()*mesArr.length);

const mesArr = [
	'Welcome back...',
	'Hi there...',
	'This is it...',
	'Look at all this...',
	'Hey...'
]


const message = () => {
	return mesArr[num]
}

const Banner = (props) => {
	return (
		<div>
			<p>{
				message()
			}</p>
			<div id='banner' title='"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'></div>
		</div>
	);
}

export default Banner;
